PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE teams (
	id INTEGER NOT NULL, 
	fname VARCHAR(128), 
	year VARCHAR(128), 
	city VARCHAR(128), 
	gender VARCHAR(1), 
	name VARCHAR(128), 
	email VARCHAR(128), 
	password VARCHAR(128), 
	website VARCHAR(128), 
	affiliation VARCHAR(128), 
	country VARCHAR(32), 
	bracket VARCHAR(32), 
	banned BOOLEAN, 
	verified BOOLEAN, 
	admin BOOLEAN, 
	mentor BOOLEAN, 
	joined DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (name), 
	UNIQUE (email), 
	CHECK (banned IN (0, 1)), 
	CHECK (verified IN (0, 1)), 
	CHECK (admin IN (0, 1)), 
	CHECK (mentor IN (0, 1))
);
CREATE TABLE challenges (
	id INTEGER NOT NULL, 
	name VARCHAR(80), 
	description TEXT, 
	max_attempts INTEGER, 
	value INTEGER, 
	category VARCHAR(80), 
	type INTEGER, 
	hidden BOOLEAN, 
	hint VARCHAR(500), 
	level INTEGER, 
	PRIMARY KEY (id), 
	CHECK (hidden IN (0, 1))
);
